fr:mainmatter.fr:p:
Suppose we are given categories, functors, and natural
transformations as follows: 




    \usepackage{tikz, tikz-cd, mathtools, amssymb}
  \usetikzlibrary{shapes.geometric}
  \usetikzlibrary{calc}
  \usetikzlibrary{matrix}
  \usetikzlibrary{decorations.markings}

  \tikzset{
    % basics
    square/.style={draw, regular polygon, regular polygon sides=4},
    triangle/.style={draw, regular polygon, regular polygon sides=3},
  }

  \tikzset{
    % string diagrams
    state/.style={triangle, shape border rotate=180, anchor=north},
    costate/.style={triangle, anchor=south},
    morphism/.style={draw, rectangle},
    over/.style={
      draw=white,
      double=black,
      % default is .4pt
      line width=1.2pt,
      double distance=.4pt,
      text=black
    },
  }

  \tikzset{ 
    % tables
    % https://tikz.net/tikz-table/
    table/.style={
        matrix of nodes,
        row sep=-\pgflinewidth,
        column sep=-\pgflinewidth,
        nodes={
            rectangle,
            draw=black,
            align=center
        },
        minimum height=1.5em,
        text depth=0.5ex,
        text height=2ex,
        nodes in empty cells,
%%
        every even row/.style={
            nodes={fill=gray!20}
        },
        column 1/.style={
            nodes={font=\bfseries}
        },
        row 1/.style={
            nodes={
                fill=black,
                text=white,
                font=\bfseries
            }
        }
    }
  }


  \begin {tikzcd}[baseline=(current bounding box.center)]
    & \Downarrow \alpha  && \Downarrow \gamma  \\[-2.1em]
    C\ar [rr, "F", bend left=50]\ar [rr, "G", near start]\ar [rr, "H"', bend
    right=50] && D\ar [rr, "J", bend left=50]\ar [rr, "K", near start]\ar [rr,
    "L"', bend right=50] && E\makebox [0pt][l]{.}\\[-2.1em]
    & \Downarrow \beta  && \Downarrow \delta 
  \end {tikzcd}


 Then the two ways to turn this data into a natural transformation JF\to  LH
using vertical composition and horizontal composition
equate. Explicitly, \delta \gamma  * \beta \alpha  = (\gamma *\alpha )(\delta *\beta ).

